import React from "react";
import CloseIcon from "@mui/icons-material/Close";
import "./Cart.css";

function Cart({ setopenCart }) {
  return (
    <>
      <div className="cart-body">
        <div className="header">
          <CloseIcon
            className="close"
            onClick={() => {
              setopenCart(false);
            }}
          />
        </div>
        <div className="cart-body"></div>
        <div className="checkout"></div>
      </div>
    </>
  );
}

export default Cart;
